import React, { useState } from 'react';
import { useAuth } from '../contexts/AuthContext';

const LandingPage = ({ onNavigate }) => {
    const { register } = useAuth();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [showPassword, setShowPassword] = useState(false);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    const handleRegister = async (e) => {
        e.preventDefault();
        setError('');
        
        if (!email || !password) {
            setError('Please enter both email and password');
            return;
        }
        
        try {
            setLoading(true);
            await register(email, password);
            onNavigate('home');
        } catch (err) {
            setError(err.message || 'Failed to create account');
        } finally {
            setLoading(false);
        }
    };

    const handleGoogleLogin = () => {
        console.log('Google login initiated');
    };

    const togglePasswordVisibility = () => {
        setShowPassword(!showPassword);
    };

    return (
        <div className="flex min-h-screen">
            {/* Left Side - Dark Blue Background */}
            <div className="w-1/2 bg-[#111827] flex flex-col">
                {/* Welcome Text - Positioned in middle of left side */}
                <div className="flex-grow flex items-center px-12">
                    <div>
                        <h1 className="text-6xl font-light text-white mb-6">
                            Welcome.
                        </h1>
                        <p className="text-4xl text-gray-400 font-light leading-relaxed">
                            Start your journey<br />
                            now with our<br />
                            management<br />
                            system!
                        </p>
                    </div>
                </div>
            </div>

            {/* Right Side - White Background that fills half */}
            <div className="w-1/2 bg-white flex items-center justify-center">
                <div className="w-[420px] mx-auto px-4">
                    <h2 className="text-3xl font-bold text-gray-800 mb-10 text-center">
                        Create an account
                    </h2>
                    
                    <div className="mb-6">
                        <label htmlFor="email" className="block text-gray-700 mb-2">
                            Email  
                        </label>
                        <input
                            id="email"
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-1 focus:ring-blue-500"
                            placeholder="balamia@gmail.com"
                            required
                        />
                    </div>

                    <div className="mb-10">
                        <label htmlFor="password" className="block text-gray-700 mb-2">
                            Password  
                        </label>
                        <div className="relative">
                            <input
                                id="password"
                                type={showPassword ? "text" : "password"}
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-1 focus:ring-blue-500"
                                placeholder="Enter your password"
                                required
                            />
                            <button
                                type="button"
                                onClick={togglePasswordVisibility}
                                className="absolute inset-y-0 right-0 flex items-center pr-4"
                            >
                                {showPassword ? (
                                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="h-5 w-5 text-gray-400">
                                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                                    </svg>
                                ) : (
                                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="h-5 w-5 text-gray-400">
                                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
                                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z" />
                                    </svg>
                                )}
                            </button>
                        </div>
                    </div>

                    <button
                        onClick={handleRegister}
                        disabled={loading}
                        className="w-full bg-blue-500 hover:bg-blue-600 text-white py-3 rounded-lg font-medium transition-colors duration-300 mb-6"
                    >
                        Create account
                    </button>

                    <div className="relative flex items-center justify-center my-6">
                        <div className="absolute border-t border-gray-300 w-full"></div>
                        <div className="bg-white px-4 relative text-sm text-gray-500">or</div>
                    </div>

                    <button
                        onClick={handleGoogleLogin}
                        className="w-full flex items-center justify-center gap-3 bg-white hover:bg-gray-50 text-gray-700 py-3 rounded-lg font-medium transition-colors duration-300 mb-10 border border-gray-300"
                    >
                        <svg className="w-5 h-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 488 512">
                            <path fill="#4285F4" d="M488 261.8C488 403.3 391.1 504 248 504 110.8 504 0 393.2 0 256S110.8 8 248 8c66.8 0 123 24.5 166.3 64.9l-67.5 64.9C258.5 52.6 94.3 116.6 94.3 256c0 86.5 69.1 156.6 153.7 156.6 98.2 0 135-70.4 140.8-106.9H248v-85.3h236.1c2.3 12.7 3.9 24.9 3.9 41.4z"/>
                        </svg>
                        Continue with Google
                    </button>

                    <div className="text-center">
                        <p className="text-gray-500">
                            Already Have An Account?{' '}
                            <button 
                                onClick={() => onNavigate('login')}
                                className="text-blue-500 hover:text-blue-600 font-medium"
                                type="button"
                            >
                                Log in
                            </button>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LandingPage;
